                </div>

                <div style={{backgroundColor:"white", width:"86vw"}} className='mt-8'>
                    <div>
                        <img src={`${publicUrl}/assets/img/blog/division/D1.svg`} alt="" />

                    </div>

                    <div>

                    </div>
                </div>





            </div>

        </div>
    );
};

export default Division;
